const DeleteQuote = async (props) => {
  // const quotes = props.quotes.filter((quote) => quote.id !== props.id);
  console.log("fuck");
  const quotes = Object.keys(props.quotes).filter((key) => key.id !== props.id);

  const responce = await fetch(
    "https://quotes-33a21-default-rtdb.firebaseio.com",
    {
      method: "POST",
      body: JSON.stringify(quotes),
      headers: {
        "Content-Type": "application/json",
      },
    }
  );

  if (!responce.ok) {
    throw new Error("Could not detele quote.");
  }
};

export default DeleteQuote;
